import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import PDF from "./PDF";

const App = () => {
    return (
        <Router>
            <div className="App">
                <Routes>
                    <Route exact path="/" element={<PDF title={"test.pdf"} />} /> 
                    <Route exact path="/technopreneur23/title" element={<PDF title={"/Pages/Technopreneur/Title_Partner.pdf"} />} /> 
                    <Route exact path="/technopreneur23/platinum" element={<PDF title={"/Pages/Technopreneur/Title_Partner.pdf"} />} /> 
                    <Route exact path="/technopreneur23/gold" element={<PDF title={"/Pages/Technopreneur/Title_Partner.pdf"} />} /> 
                    <Route exact path="/technopreneur23/custom" element={<PDF title={"/Pages/Technopreneur/Title_Partner.pdf"} />} /> 
                    <Route exact path="/technopreneur23/gift" element={<PDF title={"/Pages/Technopreneur/Title_Partner.pdf"} />} /> 
                </Routes>
            </div>
        </Router>
    );
};

export default App;
